import React from "react";
import "./sidebar.css"

const Sidebar=()=>{
    return(
        <div className="sidebar">
          <div className="sidebarWrapper">
            <ul className="sidebarList">
              <li className="sidebarListItem"></li>
            </ul>
          </div>
        </div>
    )
}

export default Sidebar;
